import React from 'react';

function contact(){

  return (<div class="container-fluid contact-container">
    <a href="https://www.linkedin.com/in/kottedheeraj/" target="_blank" class="linkedin"><i class="fab fa-linkedin fa-4x"></i></a>
    <a href="" class="facebook"><i class="fab fa-facebook-square fa-4x" ></i></a>
    <a href="" class="instagram"><i class="fab fa-instagram-square fa-4x"></i></a>
    <a href="mailto:kottedheeraj@gmail.com" target="_blank" class="gmail"><i class="fas fa-envelope-square fa-4x"></i></a>
    <a href="https://github.com/Dheeraj0650" target="_blank" class="github"><i class="fab fa-github-square fa-4x btn-8"></i></a>
  </div>);

}

export default contact;
